import React, { useEffect, useState, useCallback } from "react";
import "./App.css";
import { PatientVisualizer } from "fhir-visualizers";
import { Spinner, Container, Button, Form, Table, Alert } from "react-bootstrap";

export default function App({ client }) {
  const [patient, setPatient] = useState(null);
  const [logMessages, setLogMessages] = useState([]);
  const [documentReferences, setDocumentReferences] = useState([]);
  const [tempEdits, setTempEdits] = useState({});

  const log = useCallback((message, category = "Info", details = {}) => {
    const timestamp = new Date().toISOString();
    const formattedDetails = typeof details === "object" ? JSON.stringify(details, null, 2) : details;
    setLogMessages((prev) => [...prev, `[${timestamp}] [${category}] ${message} ${formattedDetails || ""}`]);
  }, []);

  useEffect(() => {
    if (!client) {
      log("FHIR client is not initialized.", "Error");
      return;
    }

    client.patient
      .read()
      .then((data) => {
        log("Patient data retrieved successfully.", "Success", { patient: data });
        setPatient(data);
      })
      .catch((error) => {
        log(`Error fetching patient: ${error.message}`, "Error");
      });
  }, [client, log]);

  const fetchDocumentReferences = () => {
    if (!patient) {
      log("Patient not available for document reference retrieval.", "Warning");
      return;
    }

    const url = `DocumentReference?patient=${patient.id}`;
    log("Fetching document references from FHIR server.", "Info", { url });

    client
      .request(url)
      .then((data) => {
        const docs = (data.entry || []).map((entry) => entry.resource);
        setDocumentReferences(docs);
        log("Document references retrieved successfully.", "Success", { documents: docs });
      })
      .catch((error) => {
        log(`Error retrieving document references: ${error.message}`, "Error");
      });
  };

  const handleEditChange = (docIdx, codeIdx, field, value) => {
    const key = `${docIdx}-${codeIdx}`;
    setTempEdits((prev) => ({ ...prev, [key]: { ...prev[key], [field]: value } }));
  };

  const confirmUpdate = (docIdx, codeIdx) => {
    const key = `${docIdx}-${codeIdx}`;
    const updatedCode = tempEdits[key];

    if (updatedCode) {
      const updatedDocs = documentReferences.map((doc, dIdx) => {
        if (dIdx === docIdx) {
          const updatedCodes = doc.type.coding.map((code, cIdx) =>
            cIdx === codeIdx ? { ...code, ...updatedCode } : code
          );
          return { ...doc, type: { ...doc.type, coding: updatedCodes } };
        }
        return doc;
      });

      setDocumentReferences(updatedDocs);
      setTempEdits((prev) => {
        const { [key]: _, ...rest } = prev;
        return rest;
      });
      log(`Document updated successfully for document #${docIdx}`, "Success", { updatedCode });
    }
  };

  return (
    <Container className="py-4">
      <h1 className="text-center mb-4">Patient Data Viewer</h1>

      <Alert variant="primary">
        Use this interface to view and update ICD codes and patient notes.
      </Alert>

      <div className="mb-4">
        <h4>Debug Log</h4>
        <div className="log-container" style={{ maxHeight: "200px", overflowY: "auto", background: "#f8f9fa", padding: "10px", borderRadius: "8px" }}>
          {logMessages.map((msg, idx) => (
            <p key={idx} className="text-muted small mb-1">
              {msg}
            </p>
          ))}
        </div>
      </div>

      {patient ? (
        <>
          <h4>Patient Information</h4>
          <PatientVisualizer patient={patient} />
        </>
      ) : (
        <Spinner animation="border" className="d-block mx-auto" />
      )}

      <div className="mt-4">
        <h4>Document References</h4>
        <Button onClick={fetchDocumentReferences} className="mb-3">
          Retrieve Document References
        </Button>

        {documentReferences.length > 0 ? (
          <Table striped bordered hover>
            <thead>
              <tr>
                <th>ID</th>
                <th>Type</th>
                <th>Date</th>
                <th>ICD Codes</th>
              </tr>
            </thead>
            <tbody>
              {documentReferences.map((doc, docIdx) => (
                <tr key={docIdx}>
                  <td>{doc.id}</td>
                  <td>{doc.type?.text || "Unknown"}</td>
                  <td>{doc.date || "No date available"}</td>
                  <td>
                    {doc.type.coding.map((code, codeIdx) => (
                      <div key={codeIdx} className="mb-2">
                        <Form.Control
                          type="text"
                          placeholder="System"
                          value={tempEdits[`${docIdx}-${codeIdx}`]?.system || code.system || ""}
                          onChange={(e) => handleEditChange(docIdx, codeIdx, "system", e.target.value)}
                        />
                        <Form.Control
                          type="text"
                          placeholder="Code"
                          value={tempEdits[`${docIdx}-${codeIdx}`]?.code || code.code || ""}
                          onChange={(e) => handleEditChange(docIdx, codeIdx, "code", e.target.value)}
                        />
                        <Form.Control
                          type="text"
                          placeholder="Display"
                          value={tempEdits[`${docIdx}-${codeIdx}`]?.display || code.display || ""}
                          onChange={(e) => handleEditChange(docIdx, codeIdx, "display", e.target.value)}
                        />
                        <Button
                          size="sm"
                          variant="success"
                          className="mt-2"
                          onClick={() => confirmUpdate(docIdx, codeIdx)}
                        >
                          Save
                        </Button>
                      </div>
                    ))}
                  </td>
                </tr>
              ))}
            </tbody>
          </Table>
        ) : (
          <p>No document references available.</p>
        )}
      </div>
    </Container>
  );
}
